import React from 'react';
import Data from './Data.json';
import Items from './Items.jsx';
import './all.css';
export const Update=()=>{
    return(
        <div className="Deepak">
          {Data.map((item,i)=>{
               return <Items key={i} id={item.id} price={item.price} name={item.name} action="modify Pric"/>
              })}
          </div>
)
}

export const All=()=>{
    return(
        <div className="Deepak">
          {Data.map((item,i)=>{
               return <Items key={i} id={item.id} price={item.price} name={item.name}/>
              })}
          </div>
)
}
